INSERT INTO section_config VALUES (1, 10000, '第一部分 绪 言', '<p>本招募说明书依据《中华人民共和国证券投资基金法》（以下简称“《基金法》”）、《证券 投资基金信息披露管理办法》（以下简称“《信息披露办法》”）、《公开募集证券投资基金运作 管理办法》（以下简称“《运作办法》”）、《证券投资基金销售管理办法》（以下简称“《销售办 法》”）等有关法律法规及《长城新视野混合型证券投资基金基金合同》（以下简称“基金合 同”）编写。 本招募说明书阐述了长城新视野混合型证券投资基金的投资目标、策略、风险、费率 等与投资者投资决策有关的全部必要事项，投资者在做出投资决策前应仔细阅读本招募说 明书。 基金管理人承诺本招募说明书不存在任何虚假记载、误导性陈述或者重大遗漏，并对 其真实性、准确性、完整性承担法律责任。本基金是根据本招募说明书所载明的资料申请 募集的。本基金管理人没有委托或授权任何其他人提供未在本招募说明书中载明的信息， 或对本招募说明书做出任何解释或者说明。 本招募说明书根据本基金的基金合同编写，并经中国证监会注册。基金合同是约定基 金当事人之间权利、义务的法律文件。基金投资者自依基金合同取得基金份额，即成为基 金份额持有人和本基金合同的当事人，其持有基金份额的行为本身即表明其对基金合同的 承认和接受，并按照《基金法》、基金合同及其他规定享有权利、承担义务。基金投资者 欲了解基金份额持有人的权利和义务，应详细查阅本基金基金合同。 @1112<br></p>');
INSERT INTO section_config VALUES (2, 20000, '第二部分 释 义', '<div>在本招募说明书中，除非文意另有所指，下列词语或简称具有如下含义： <br> 1、基金或本基金：指长城新视野混合型证券投资基金 <br> 2、基金管理人：指长城基金管理有限公司 <br> 3、基金托管人：指中国民生银行股份有限公司 <br> 4、基金合同或本基金合同：指《长城新视野混合型证券投资基金基金合同》及对本基金合同的任何有效修订和补充 <br> 5、托管协议：指基金管理人与基金托管人就本基金签订之《长城新视野混合型证券投资基金托管协议》及对该托管协议的任何有效修订和补充 <br> 6、招募说明书：指《长城新视野混合型证券投资基金招募说明书》及其定期的更新 <br> 7、基金份额发售公告：指《长城新视野混合型证券投资基金基金份额发售公告》 <br> 8、法律法规：指中国现行有效并公布实施的法律、行政法规、规范性文件、司法解释、 行政规章以及其他对基金合同当事人有约束力的决定、决议、通知等 <br> 9、《基金法》：指《中华人民共和国证券投资基金法》及颁布机关对其不时做出的修订 <br> 10、《销售办法》：指《证券投资基金销售管理办法》及颁布机关对其不时做出的修订 <br> 11、《信息披露办法》：指《证券投资基金信息披露管理办法》及颁布机关对其不时做 出的修订 <br> 12、《运作办法》：指《公开募集证券投资基金运作管理办法》及颁布机关对其不时做出的修订 <br> 13、中国证监会：指中国证券监督管理委员会 <br> 14、银行业监督管理机构：指中国人民银行和/或中国银行业监督管理委员会 <br> 15、基金合同当事人：指受基金合同约束，根据基金合同享有权利并承担义务的法律主 体，包括基金管理人、基金托管人和基金份额持有人 <br> 16、个人投资者：指依据有关法律法规规定可投资于证券投资基金的自然人 <br> 17、机构投资者：指依法可以投资证券投资基金的、在中华人民共和国境内合法登记并 存续或经有关政府部门批准设立并存续的企业法人、事业法人、社会团体或其他组织 <br> 18、合格境外机构投资者：指符合《合格境外机构投资者境内证券投资管理办法》及相 关法律法规规定可以投资于在中国境内依法募集的证券投资基金的中国境外的机构投资者 <br> 19、投资人：指个人投资者、机构投资者和合格境外机构投资者以及法律法规或中国证 监会允许购买证券投资基金的其他投资人的合称 <br> 20、基金份额持有人：指依基金合同和招募说明书合法取得基金份额的投资人 <br> 21、基金销售业务：指基金管理人或销售机构宣传推介基金，发售基金份额，办理基金份额的申购、赎回、转换、非交易过户、转托管及定期定额投资等业务。 <br> 22、销售机构：指长城基金管理有限公司以及符合《销售办法》和中国证监会规定的其他条件，取得基金销售业务资格并与基金管理人签订了基金销售服务代理协议，代为办理基金销售业务的机构 <br> 23、直销机构：指长城基金管理有限公司 <br> 24、代销机构：指符合《销售办法》和中国证监会规定的其他条件，取得基金代销业务 资格并与基金管理人签订了基金销售服务代理协议，代为办理基金销售业务的机构 <br> 25、基金销售网点：指直销机构的直销中心及代销机构的代销网点 <br> 26、登记业务：指基金登记、存管、过户、清算和结算业务，具体内容包括投资人基金账户的建立和管理、基金份额登记、基金销售业务的确认、清算和结算、代理发放红利、建立并保管基金份额 持有人名册和办理非交易过户等 <br> 27、登记机构：指办理登记业务的机构。基金的登记机构为长城基金管理有限公司或接 受长城基金管理有限公司委托代为办理登记业务的机构 <br> 28、基金账户：指登记机构为投资人开立的、记录其持有的、基金管理人所管理的基金 份额余额及其变动情况的账户 <br> 29、基金交易账户：指销售机构为投资人开立的、记录投资人通过该销售机构买卖基金 的基金份额变动及结余情况的账户 <br> 30、基金合同生效日：指基金募集达到法律法规规定及基金合同规定的条件，基金管理 人向中国证监会办理基金备案手续完毕，并获得中国证监会书面确认的日期 <br> 31、基金合同终止日：指基金合同规定的基金合同终止事由出现后，基金财产清算完毕， 清算结果报中国证监会备案并予以公告的日期 <br> 32、基金募集期：指自基金份额发售之日起至发售结束之日止的期间，最长不得超过三 个月 <br> 33、存续期：指基金合同生效至终止之间的不定期期限 <br> 34、工作日：指上海证券交易所、深圳证券交易所的正常交易日<br> 35、T 日：指销售机构在规定时间受理投资人申购、赎回或其他业务申请的开放日 <br> 36、T+n 日：指自 T 日起第 n 个工作日(不包含 T 日) <br> 37、开放日：指为投资人办理基金份额申购、赎回或其他业务的工作日 <br> 38、开放时间：指开放日基金接受申购、赎回或其他交易的时间段 <br> 39、《业务规则》：指长城基金管理有限公司开放式基金业务规则，是规范基金管理人所管理的开放式证券投资基金登记方面的业务规则，由基金管理人和投资人共同遵守 <br> 40、认购：指在基金募集期内，投资人申请购买基金份额的行为 <br> 41、申购：指基金合同生效后，投资人根据基金合同和招募说明书的规定申请购买基金 份额的行为 <br> 42、赎回：指基金合同生效后，基金份额持有人按基金合同规定的条件要求将基金份额 兑换为现金的行为 <br> 43、基金转换：指基金份额持有人按照本基金合同和基金管理人届时有效公告规定的条 件，申请将其持有基金管理人管理的、某一基金的基金份额转换为基金管理人管理的其他基金基金份额的行为 <br> 44、转托管：指基金份额持有人在本基金的不同销售机构之间实施的变更所持基金份额 销售机构的操作 <br> 45、定期定额投资计划：指投资人通过有关销售机构提出申请，约定每期申购日、扣款 金额及扣款方式，由销售机构于每期约定扣款日在投资人指定银行账户内自动完成扣款及基金申购申请的一种投资方式 <br> 46、巨额赎回：指本基金单个开放日，基金净赎回申请(赎回申请份额总数加上基金转换中转出申请份额总数后扣除申购申请份额总数及基金转换中转入申请份额总数后的余额)超过上一开放日基金总份额的 10% <br> 47、元：指人民币元 <br> 48、基金收益：指基金投资所得红利、股息、债券利息、买卖证券价差、银行存款利息、 已实现的其他合法收入及因运用基金财产带来的成本和费用的节约 <br> 49、基金资产总值：指基金拥有的各类有价证券、银行存款本息、基金应收申购款及其他资产的价值总和 <br> 50、基金资产净值：指基金资产总值减去基金负债后的价值\n51、基金份额净值：指计算日基金资产净值除以计算日基金份额总数 <br> 52、基金资产估值：指计算评估基金资产和负债的价值，以确定基金资产净值和基金份额净值的过程 <br> 53、指定媒介：指中国证监会指定的用以进行信息披露的报刊、互联网网站及其他媒介\n</div><div>54、不可抗力：指本合同当事人不能预见、不能避免且不能克服的客观事件</div><p><br></p>');
